                <div className="item col-md-5 col-sm-10" style={{alignContent:'center', border:'solid', marginRight:'2%', marginTop:'2%', paddingTop:'3%', borderRadius:'10px', backgroundColor:'white'}}>
                    <p><b>ID : {props._id}</b></p>
