                    <p><b>Phone : {props.phone}</b></p>
                    <p><b>Email : {props.email}</b></p>
                    <p><button className='btn btn-primary' type="button" onClick={handleClick}  variant="primary" style={{borderRadius:'10px',width:'auto',height:'auto'}}>Remove Account</button></p> 
                </div>  

    )   
    
    }

export default Adminlist1;
